20251001104127	{"-- Enable RLS on unprotected tables\nALTER TABLE public.agents ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.documents ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.traits ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.tool_runs ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.moderation_logs ENABLE ROW LEVEL SECURITY;\n\n-- AGENTS: Public read, authenticated write\nCREATE POLICY \\"agents_public_read\\" ON public.agents\n  FOR SELECT USING (true);\n\nCREATE POLICY \\"agents_authenticated_insert\\" ON public.agents\n  FOR INSERT WITH CHECK (auth.uid() IS NOT NULL);\n\nCREATE POLICY \\"agents_authenticated_update\\" ON public.agents\n  FOR UPDATE USING (auth.uid() IS NOT NULL);\n\nCREATE POLICY \\"agents_authenticated_delete\\" ON public.agents\n  FOR DELETE USING (auth.uid() IS NOT NULL);\n\n-- DOCUMENTS: Users own their documents\nCREATE POLICY \\"documents_select\\" ON public.documents\n  FOR SELECT USING (\n    metadata->>'user_id' = auth.uid()::text OR\n    metadata->>'user_id' IS NULL\n  );\n\nCREATE POLICY \\"documents_insert\\" ON public.documents\n  FOR INSERT WITH CHECK (\n    metadata->>'user_id' = auth.uid()::text OR\n    auth.uid() IS NOT NULL\n  );\n\nCREATE POLICY \\"documents_update\\" ON public.documents\n  FOR UPDATE USING (metadata->>'user_id' = auth.uid()::text);\n\nCREATE POLICY \\"documents_delete\\" ON public.documents\n  FOR DELETE USING (metadata->>'user_id' = auth.uid()::text);\n\n-- TRAITS: Public read, authenticated write\nCREATE POLICY \\"traits_public_read\\" ON public.traits\n  FOR SELECT USING (true);\n\nCREATE POLICY \\"traits_authenticated_insert\\" ON public.traits\n  FOR INSERT WITH CHECK (auth.uid() IS NOT NULL);\n\nCREATE POLICY \\"traits_authenticated_update\\" ON public.traits\n  FOR UPDATE USING (auth.uid() IS NOT NULL);\n\nCREATE POLICY \\"traits_authenticated_delete\\" ON public.traits\n  FOR DELETE USING (auth.uid() IS NOT NULL);\n\n-- TOOL_RUNS: Only accessible via conversation ownership\nCREATE POLICY \\"tool_runs_select\\" ON public.tool_runs\n  FOR SELECT USING (\n    EXISTS (\n      SELECT 1 FROM messages m\n      JOIN conversations c ON c.id = m.conversation_id\n      WHERE m.id = tool_runs.message_id\n      AND (c.user_id = auth.uid() OR c.user_id IS NULL)\n    )\n  );\n\nCREATE POLICY \\"tool_runs_insert\\" ON public.tool_runs\n  FOR INSERT WITH CHECK (\n    EXISTS (\n      SELECT 1 FROM messages m\n      JOIN conversations c ON c.id = m.conversation_id\n      WHERE m.id = tool_runs.message_id\n      AND (c.user_id = auth.uid() OR c.user_id IS NULL OR auth.uid() IS NOT NULL)\n    )\n  );\n\n-- MODERATION_LOGS: Linked to message ownership\nCREATE POLICY \\"moderation_logs_select\\" ON public.moderation_logs\n  FOR SELECT USING (\n    EXISTS (\n      SELECT 1 FROM messages m\n      JOIN conversations c ON c.id = m.conversation_id\n      WHERE m.id = moderation_logs.message_id\n      AND (c.user_id = auth.uid() OR c.user_id IS NULL)\n    )\n  );\n\nCREATE POLICY \\"moderation_logs_insert\\" ON public.moderation_logs\n  FOR INSERT WITH CHECK (auth.uid() IS NOT NULL OR auth.role() = 'service_role');\n\n-- FIX CHAT_USERS: Replace overly permissive policy\nDROP POLICY IF EXISTS \\"chat_users_all\\" ON public.chat_users;\n\nCREATE POLICY \\"chat_users_select\\" ON public.chat_users\n  FOR SELECT USING (\n    linked_user_id = auth.uid() OR \n    auth.uid() IS NOT NULL OR\n    true  -- Allow public read for platform integration\n  );\n\nCREATE POLICY \\"chat_users_insert\\" ON public.chat_users\n  FOR INSERT WITH CHECK (\n    linked_user_id = auth.uid() OR \n    auth.uid() IS NOT NULL OR\n    true  -- Allow platform integration\n  );\n\nCREATE POLICY \\"chat_users_update\\" ON public.chat_users\n  FOR UPDATE USING (\n    linked_user_id = auth.uid() OR \n    auth.uid() IS NOT NULL\n  );\n\nCREATE POLICY \\"chat_users_delete\\" ON public.chat_users\n  FOR DELETE USING (linked_user_id = auth.uid());\n\n-- FIX INTERACTIONS: Users see their own interactions\nDROP POLICY IF EXISTS \\"interactions_all\\" ON public.interactions;\n\nCREATE POLICY \\"interactions_select\\" ON public.interactions\n  FOR SELECT USING (\n    EXISTS (\n      SELECT 1 FROM chat_users cu\n      WHERE cu.platform_user_id = interactions.platform_user_id\n      AND cu.linked_user_id = auth.uid()\n    ) OR\n    auth.uid() IS NOT NULL OR\n    true  -- Allow for analytics/platform needs\n  );\n\nCREATE POLICY \\"interactions_insert\\" ON public.interactions\n  FOR INSERT WITH CHECK (true);  -- Allow platform to log all interactions\n\nCREATE POLICY \\"interactions_update\\" ON public.interactions\n  FOR UPDATE USING (auth.uid() IS NOT NULL);\n\nCREATE POLICY \\"interactions_delete\\" ON public.interactions\n  FOR DELETE USING (auth.uid() IS NOT NULL);\n\n-- FIX LOCKS: Service role and authenticated users\nDROP POLICY IF EXISTS \\"locks open during dev\\" ON public.locks;\nDROP POLICY IF EXISTS \\"locks view access\\" ON public.locks;\nDROP POLICY IF EXISTS \\"locks_dev_access\\" ON public.locks;\n\nCREATE POLICY \\"locks_select\\" ON public.locks\n  FOR SELECT USING (auth.uid() IS NOT NULL);\n\nCREATE POLICY \\"locks_insert\\" ON public.locks\n  FOR INSERT WITH CHECK (auth.uid() IS NOT NULL OR auth.role() = 'service_role');\n\nCREATE POLICY \\"locks_update\\" ON public.locks\n  FOR UPDATE USING (auth.uid() IS NOT NULL OR auth.role() = 'service_role');\n\nCREATE POLICY \\"locks_delete\\" ON public.locks\n  FOR DELETE USING (auth.uid() IS NOT NULL OR auth.role() = 'service_role');"}		alisonhattlovesyou@gmail.com	\N
20251001104154	{"-- Fix security definer views by recreating them without SECURITY DEFINER\nDROP VIEW IF EXISTS public.db_schema_map CASCADE;\nCREATE VIEW public.db_schema_map AS\nSELECT \n  c.table_name,\n  c.column_name,\n  c.data_type,\n  c.ordinal_position\nFROM information_schema.columns c\nWHERE c.table_schema = 'public'\nORDER BY c.table_name, c.ordinal_position;\n\nDROP VIEW IF EXISTS public.recent_context CASCADE;\nCREATE VIEW public.recent_context AS\nSELECT \n  m.conversation_id,\n  m.role,\n  m.content,\n  m.created_at\nFROM messages m\nORDER BY m.created_at DESC\nLIMIT 50;\n\n-- Fix function search paths for security definer functions\nCREATE OR REPLACE FUNCTION public.touch_agents()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $function$\nbegin\n  new.updated_at = now();\n  return new;\nend \n$function$;\n\nCREATE OR REPLACE FUNCTION public.tg_set_updated_at()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $function$\nbegin \n  new.updated_at = now(); \n  return new; \nend \n$function$;\n\nCREATE OR REPLACE FUNCTION public.memories_needing_backfill(p_limit integer DEFAULT 100)\nRETURNS TABLE(id uuid, content text)\nLANGUAGE sql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $function$\n  select id, content\n  from public.memories\n  where embedding is null\n     or embedding::text = 'None'\n  limit p_limit;\n$function$;\n\n-- Recreate remember_fact with proper search_path (already has it, but let's ensure it's correct)\nCREATE OR REPLACE FUNCTION public.remember_fact(p_user uuid, p_agent uuid, p_scope memory_scope, p_content text, p_importance smallint DEFAULT 3)\nRETURNS uuid\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $function$\ndeclare new_id uuid;\nbegin\n  insert into memories (user_id, agent_id, scope, content, importance)\n  values (p_user, p_agent, p_scope, p_content, p_importance)\n  returning id into new_id;\n  return new_id;\nend;\n$function$;"}		alisonhattlovesyou@gmail.com	\N
