tion$;"}		alisonhattlovesyou@gmail.com	\N
20251001055511	{"-- RLS policies for ops.lava_webhook_events\n-- Allow service role to insert webhook events\nCREATE POLICY \\"service_role_insert\\" \nON ops.lava_webhook_events \nFOR INSERT \nTO service_role\nWITH CHECK (true);\n\n-- Allow service role to select webhook events\nCREATE POLICY \\"service_role_select\\" \nON ops.lava_webhook_events \nFOR SELECT \nTO service_role\nUSING (true);\n\n-- RLS policies for ops.lava_customers\n-- Allow service role to insert/upsert customers\nCREATE POLICY \\"service_role_insert\\" \nON ops.lava_customers \nFOR INSERT \nTO service_role\nWITH CHECK (true);\n\n-- Allow service role to select customers\nCREATE POLICY \\"service_role_select\\" \nON ops.lava_customers \nFOR SELECT \nTO service_role\nUSING (true);\n\n-- Allow service role to update customers\nCREATE POLICY \\"service_role_update\\" \nON ops.lava_customers \nFOR UPDATE \nTO service_role\nUSING (true)\nWITH CHECK (true);"}		alisonhattlovesyou@gmail.com	\N
20251001060104	{"-- Move lava_webhook_events and lava_customers from ops schema to public schema\n\n-- First, drop the existing policies from ops schema tables\nDROP POLICY IF EXISTS \\"service_role_insert\\" ON ops.lava_webhook_events;\nDROP POLICY IF EXISTS \\"service_role_select\\" ON ops.lava_webhook_events;\nDROP POLICY IF EXISTS \\"service_role_insert\\" ON ops.lava_customers;\nDROP POLICY IF EXISTS \\"service_role_select\\" ON ops.lava_customers;\nDROP POLICY IF EXISTS \\"service_role_update\\" ON ops.lava_customers;\n\n-- Move tables to public schema\nALTER TABLE ops.lava_webhook_events SET SCHEMA public;\nALTER TABLE ops.lava_customers SET SCHEMA public;\n\n-- Recreate RLS policies in public schema\nCREATE POLICY \\"service_role_insert\\" \nON public.lava_webhook_events \nFOR INSERT \nTO service_role\nWITH CHECK (true);\n\nCREATE POLICY \\"service_role_select\\" \nON public.lava_webhook_events \nFOR SELECT \nTO service_role\nUSING (true);\n\nCREATE POLICY \\"service_role_insert\\" \nON public.lava_customers \nFOR INSERT \nTO service_role\nWITH CHECK (true);\n\nCREATE POLICY \\"service_role_select\\" \nON public.lava_customers \nFOR SELECT \nTO service_role\nUSING (true);\n\nCREATE POLICY \\"service_role_update\\" \nON public.lava_customers \nFOR UPDATE \nTO service_role\nUSING (true)\nWITH CHECK (true);"}		alisonhattlovesyou@gmail.com	\N
20251009051005	{"-- ============================================================\n-- Alison Brain v5 Supabase Contract (Fixed)\n-- Additive, non-destructive schema additions\n-- ============================================================\n\n-- 1) Create missing tables\n\n-- USER ACCESS / PAYWALL\nCREATE TABLE IF NOT EXISTS public.user_access (\n  user_id TEXT PRIMARY KEY,\n  tier TEXT DEFAULT 'free',\n  credits INT DEFAULT 0,\n  updated_at TIMESTAMPTZ DEFAULT now()\n);\n\nALTER TABLE public.user_access ENABLE ROW LEVEL SECURITY;\n\nCREATE POLICY \\"Service role can manage user_access\\"\nON public.user_access\nFOR ALL\nUSING (auth.role() = 'service_role');\n\n-- ABUSE / INTEGRITY\nCREATE TABLE IF NOT EXISTS public.abuse_strikes (\n  id BIGSERIAL PRIMARY KEY,\n  user_id TEXT NOT NULL,\n  kind TEXT NOT NULL,\n  created_at TIMESTAMPTZ DEFAULT now()\n);\n\nALTER TABLE public.abuse_strikes ENABLE ROW LEVEL SECURITY;\n\nCREATE POLICY \\"Service role can manage abuse_strikes\\"\nON public.abuse_strikes\nFOR ALL\nUSING (auth.role() = 'service_role');\n\n-- PRODUCTS (optional)\nCREATE TABLE IF NOT EXISTS public.products (\n  id BIGSERIAL PRIMARY KEY,\n  sku TEXT UNIQUE,\n  name TEXT NOT NULL,\n  price_cents INT NOT NULL,\n  active BOOLEAN DEFAULT true\n);\n\nALTER TABLE public.products ENABLE ROW LEVEL SECURITY;\n\nCREATE POLICY \\"Anyone can view active products\\"\nON public.products\nFOR SELECT\nUSING (active = true);\n\n-- Indexes\nCREATE INDEX IF NOT EXISTS idx_strikes_user ON public.abuse_strikes(user_id);\nCREATE INDEX IF NOT EXISTS idx_user_access_user ON public.user_access(user_id);\n\n-- 2) Create the user_overview_v view\nCREATE OR REPLACE VIEW public.user_overview_v AS\nSELECT\n  cu.platform,\n  (cu.platform || ':' || cu.platform_user_id) AS conversation_id,\n  cu.platform_user_id AS user_id,\n  cu.username,\n  cu.display_name,\n  COALESCE(a.tier, 'free') AS tier,\n  COALESCE(a.credits, 0) AS credits,\n  COALESCE(s.strike_count, 0) AS strikes,\n  (COALESCE(s.ban_count, 0) > 0) AS is_banned,\n  cu.created_at,\n  cu.last_seen_at AS last_seen\nFROM public.chat_users cu\nLEFT JOIN public.user_access a ON a.user_id = cu.platform_user_id\nLEFT JOIN (\n  SELECT\n    user_id,\n    COUNT(*) FILTER (WHERE kind = 'ban') AS ban_count,\n    COUNT(*) AS strike_count\n  FROM public.abuse_strikes\n  GROUP BY user_id\n) s ON s.user_id = cu.platform_user_id;\n\n-- 3) Create the get_recent_messages RPC function\n-- Parses \\"platform:user_id\\" format and returns messages\nCREATE OR REPLACE FUNCTION public.get_recent_messages(\n  conversation_id TEXT,\n  max_rows INT DEFAULT 20\n)\nRETURNS TABLE (\n  id UUID,\n  conversation_id_out TEXT,\n  role TEXT,\n  content TEXT,\n  token_estimate INT,\n  created_at TIMESTAMPTZ\n)\nLANGUAGE SQL\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\n  WITH parsed AS (\n    SELECT\n      split_part(conversation_id, ':', 1) AS platform,\n      split_part(conversation_id, ':', 2) AS platform_user_id\n  ),\n  user_conversation AS (\n    SELECT c.id AS conv_id\n    FROM public.conversations c\n    JOIN public.chat_users cu ON cu.id = c.user_id\n    CROSS JOIN parsed p\n    WHERE cu.platform = p.platform \n      AND cu.platform_user_id = p.platform_user_id\n    LIMIT 1\n  )\n  SELECT\n    m.id,\n    conversation_id AS conversation_id_out,\n    m.role::TEXT,\n    m.content,\n    m.tokens AS token_estimate,\n    m.created_at\n  FROM public.messages m\n  JOIN user_conversation uc ON uc.conv_id = m.conversation_id\n  ORDER BY m.created_at DESC\n  LIMIT GREATEST(COALESCE(max_rows, 20), 1);\n$$;\n\n-- 4) Notify PostgREST to reload schema\nSELECT pg_notify('pgrst', 'reload schema');\n\n-- 5) Grant permissions\nGRANT SELECT ON public.user_overview_v TO anon, authenticated;\nGRANT EXECUTE ON FUNCTION public.get_recent_messages(TEXT, INT) TO anon, authenticated;"}		alisonhattlovesyou@gmail.com	\N
20251009051056	{"-- ============================================================\n-- Alison Brain v5 Supabase Contract (Clean)\n-- Handles existing objects gracefully\n-- ============================================================\n\n-- 1) Create missing tables\nCREATE TABLE IF NOT EXISTS public.user_access (\n  user_id TEXT PRIMARY KEY,\n  tier TEXT DEFAULT 'free',\n  credits INT DEFAULT 0,\n  updated_at TIMESTAMPTZ DEFAULT now()\n);\n\nALTER TABLE public.user_access ENABLE ROW LEVEL SECURITY;\n\nDROP POLICY IF EXISTS \\"Service role can manage user_access\\" ON public.user_access;\nCREATE POLICY \\"Service role can manage user_access\\"\nON public.user_access\nFOR ALL\nUSING (auth.role() = 'service_role');\n\n-- ABUSE / INTEGRITY\nCREATE TABLE IF NOT EXISTS public.abuse_strikes (\n  id BIGSERIAL PRIMARY KEY,\n  user_id TEXT NOT NULL,\n  kind TEXT NOT NULL,\n  created_at TIMESTAMPTZ DEFAULT now()\n);\n\nALTER TABLE public.abuse_strikes ENABLE ROW LEVEL SECURITY;\n\nDROP POLICY IF EXISTS \\"Service role can manage abuse_strikes\\" ON public.abuse_strikes;\nCREATE POLICY \\"Service role can manage abuse_strikes\\"\nON public.abuse_strikes\nFOR ALL\nUSING (auth.role() = 'service_role');\n\n-- PRODUCTS\nCREATE TABLE IF NOT EXISTS public.products (\n  id BIGSERIAL PRIMARY KEY,\n  sku TEXT UNIQUE,\n  name TEXT NOT NULL,\n  price_cents INT NOT NULL,\n  active BOOLEAN DEFAULT true\n);\n\nALTER TABLE public.products ENABLE ROW LEVEL SECURITY;\n\nDROP POLICY IF EXISTS \\"Anyone can view active products\\" ON public.products;\nCREATE POLICY \\"Anyone can view active products\\"\nON public.products\nFOR SELECT\nUSING (active = true);\n\n-- Indexes\nCREATE INDEX IF NOT EXISTS idx_strikes_user ON public.abuse_strikes(user_id);\nCREATE INDEX IF NOT EXISTS idx_user_access_user ON public.user_access(user_id);\n\n-- 2) Create the user_overview_v view\nCREATE OR REPLACE VIEW public.user_overview_v AS\nSELECT\n  cu.platform,\n  (cu.platform || ':' || cu.platform_user_id) AS conversation_id,\n  cu.platform_user_id AS user_id,\n  cu.username,\n  cu.display_name,\n  COALESCE(a.tier, 'free') AS tier,\n  COALESCE(a.credits, 0) AS credits,\n  COALESCE(s.strike_count, 0) AS strikes,\n  (COALESCE(s.ban_count, 0) > 0) AS is_banned,\n  cu.created_at,\n  cu.last_seen_at AS last_seen\nFROM public.chat_users cu\nLEFT JOIN public.user_access a ON a.user_id = cu.platform_user_id\nLEFT JOIN (\n  SELECT\n    user_id,\n    COUNT(*) FILTER (WHERE kind = 'ban') AS ban_count,\n    COUNT(*) AS strike_count\n  FROM public.abuse_strikes\n  GROUP BY user_id\n) s ON s.user_id = cu.platform_user_id;\n\n-- 3) Create the get_recent_messages RPC function\nCREATE OR REPLACE FUNCTION public.get_recent_messages(\n  conversation_id TEXT,\n  max_rows INT DEFAULT 20\n)\nRETURNS TABLE (\n  id UUID,\n  conversation_id_out TEXT,\n  role TEXT,\n  content TEXT,\n  token_estimate INT,\n  created_at TIMESTAMPTZ\n)\nLANGUAGE SQL\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\n  WITH parsed AS (\n    SELECT\n      split_part(conversation_id, ':', 1) AS platform,\n      split_part(conversation_id, ':', 2) AS platform_user_id\n  ),\n  user_conversation AS (\n    SELECT c.id AS conv_id\n    FROM public.conversations c\n    JOIN public.chat_users cu ON cu.id = c.user_id\n    CROSS JOIN parsed p\n    WHERE cu.platform = p.platform \n      AND cu.platform_user_id = p.platform_user_id\n    LIMIT 1\n  )\n  SELECT\n    m.id,\n    conversation_id AS conversation_id_out,\n    m.role::TEXT,\n    m.content,\n    m.tokens AS token_estimate,\n    m.created_at\n  FROM public.messages m\n  JOIN user_conversation uc ON uc.conv_id = m.conversation_id\n  ORDER BY m.created_at DESC\n  LIMIT GREATEST(COALESCE(max_rows, 20), 1);\n$$;\n\n-- 4) Notify PostgREST to reload schema\nSELECT pg_notify('pgrst', 'reload schema');\n\n-- 5) Grant permissions\nGRANT SELECT ON public.user_overview_v TO anon, authenticated;\nGRANT EXECUTE ON FUNCTION public.get_recent_messages(TEXT, INT) TO anon, authenticated;"}		alisonhattlovesyou@gmail.com	\N
20251010122706	{"-- Fix RLS policies on lava_webhook_events to restrict access to service_role only\n-- This prevents public access to sensitive payment webhook data\n\n-- Drop existing overly permissive policies\nDROP POLICY IF EXISTS \\"service_role_select\\" ON public.lava_webhook_events;\nDROP POLICY IF EXISTS \\"service_role_insert\\" ON public.lava_webhook_events;\n\n-- Create new policies that properly check for service_role\nCREATE POLICY \\"service_role_select\\" \nON public.lava_webhook_events \nFOR SELECT \nUSING (auth.role() = 'service_role');\n\nCREATE POLICY \\"service_role_insert\\" \nON public.lava_webhook_events \nFOR INSERT \nWITH CHECK (auth.role() = 'service_role');"}		alisonhattlovesyou@gmail.com	\N
20251010123116	{"-- Fix security issues without affecting n8n service role access\n-- Service role bypasses RLS, so these changes won't impact n8n functionality\n\n-- 1. Fix interactions table public exposure\nDROP POLICY IF EXISTS \\"interactions_select\\" ON public.interactions;\nCREATE POLICY \\"interactions_select\\" \nON public.interactions \nFOR SELECT \nUSING (\n  EXISTS (\n    SELECT 1 FROM chat_users cu \n    WHERE cu.platform_user_id = interactions.platform_user_id \n    AND cu.linked_user_id = auth.uid()\n  ) \n  OR auth.uid() IS NOT NULL\n);\n\n-- 2. Drop the db_schema_map view since it exposes database structure\n-- n8n with service role can still query information_schema directly if needed\nDROP VIEW IF EXISTS public.db_schema_map;\n\n-- 3. Fix functions without fixed search_path\nCREATE OR REPLACE FUNCTION public.whoami()\nRETURNS jsonb\nLANGUAGE sql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\n  select jsonb_build_object(\n    'current_user', current_user,\n    'role', current_setting('role', true),\n    'jwt', coalesce(current_setting('request.jwt.claims', true)::jsonb, '{}'::jsonb)\n  );\n$$;\n\nCREATE OR REPLACE FUNCTION public.remember_fact(\n  p_user uuid, \n  p_agent uuid, \n  p_scope memory_scope, \n  p_content text, \n  p_importance smallint DEFAULT 3\n)\nRETURNS uuid\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\ndeclare new_id uuid;\nbegin\n  insert into memories (user_id, agent_id, scope, content, importance)\n  values (p_user, p_agent, p_scope, p_content, p_importance)\n  returning id into new_id;\n  return new_id;\nend;\n$$;"}		alisonhattlovesyou@gmail.com	\N
20251023053758	{"\n-- Fix SECURITY DEFINER views by setting security_invoker = true\n-- This makes views enforce RLS of the querying user, not the view creator\n\n-- Recreate chat_history_v with security_invoker\nCREATE OR REPLACE VIEW public.chat_history_v\nWITH (security_invoker = true)\nAS\nSELECT c.id AS conversation_id,\n    (c.metadata ->> 'platform'::text) AS platform,\n    (c.metadata ->> 'chat_key'::text) AS chat_key,\n    (c.metadata ->> 'key_kind'::text) AS key_kind,\n    c.created_at AS conversation_started,\n    m.role,\n    CASE\n        WHEN ((m.role = 'assistant'::msg_role) AND (m.content ~ '^{'::text)) \n        THEN COALESCE((((m.content)::jsonb -> 'response'::text) ->> 'message'::text), m.content)\n        ELSE m.content\n    END AS message_text,\n    m.created_at AS message_time\nFROM messages m\nJOIN conversations c ON c.id = m.conversation_id\nORDER BY c.created_at, m.created_at;\n\n-- Recreate recent_context with security_invoker\nCREATE OR REPLACE VIEW public.recent_context\nWITH (security_invoker = true)\nAS\nSELECT conversation_id,\n    role,\n    content,\n    created_at\nFROM messages m\nORDER BY created_at DESC\nLIMIT 50;\n\n-- Recreate user_overview_v with security_invoker\nCREATE OR REPLACE VIEW public.user_overview_v\nWITH (security_invoker = true)\nAS\nSELECT u.id,\n    u.display_name,\n    u.username,\n    u.platform,\n    u.platform_user_id,\n    u.chat_id,\n    u.last_seen_at,\n    u.summary,\n    COALESCE(cs.total_conversations, 0::bigint) AS total_conversations,\n    GREATEST(u.last_seen_at, cs.last_message_at) AS last_message_at\nFROM users u\nLEFT JOIN LATERAL (\n    SELECT count(*) AS total_conversations,\n           max(m.created_at) AS last_message_at\n    FROM conversations c\n    LEFT JOIN messages m ON m.conversation_id = c.id\n    WHERE c.user_id = u.id\n) cs ON true;\n\n-- Recreate user_profile_overview_v with security_invoker\nCREATE OR REPLACE VIEW public.user_profile_overview_v\nWITH (security_invoker = true)\nAS\nSELECT id,\n    display_name,\n    username,\n    platform,\n    platform_user_id,\n    chat_id,\n    last_seen_at,\n    summary,\n    (profile ->> 'preferred_name'::text) AS preferred_name,\n    (profile ->> 'relationship'::text) AS relationship,\n    (profile ->> 'location'::text) AS location,\n    (profile ->> 'occupation'::text) AS occupation,\n    (profile ->> 'goals'::text) AS goals,\n    (profile ->> 'family'::text) AS family,\n    (profile ->> 'personality'::text) AS personality,\n    (profile ->> 'ongoing_topic'::text) AS ongoing_topic,\n    (profile ->> 'tone'::text) AS tone,\n    (\n        SELECT string_agg(s.x, ', '::text ORDER BY s.ord)\n        FROM (\n            SELECT t.value AS x, t.ord\n            FROM jsonb_array_elements_text(COALESCE((u.profile -> 'interests'::text), '[]'::jsonb)) \n            WITH ORDINALITY t(value, ord)\n            WHERE t.ord <= 5\n        ) s\n    ) AS interests\nFROM users u;\n"}		alisonhattlovesyou@gmail.com	\N
20251023054323	{"\n-- ============================================================================\n-- Supabase Vector Memory Layer v1 - Long-term User Personalization\n-- ============================================================================\n-- Non-disruptive add-on for rolling summaries + evergreen profile memory\n-- Works alongside existing Pinecone/Mongo without changes\n-- Service-role access from n8n agent\n\n-- ============================================================================\n-- 1. TIME-BOXED SUMMARIES TABLE\n-- ============================================================================\n-- Rolling summaries: day/week/lifetime windows per user\nCREATE TABLE IF NOT EXISTS public.user_memory_summaries (\n  id            bigserial PRIMARY KEY,\n  user_id       uuid NOT NULL REFERENCES public.users(id) ON DELETE CASCADE,\n  time_window   text NOT NULL, -- 'day:YYYY-MM-DD' | 'week:YYYY-Www' | 'lifetime'\n  tag           text NOT NULL DEFAULT 'general',\n  summary_text  text NOT NULL,\n  metadata      jsonb NOT NULL DEFAULT '{}',\n  embedding     vector(1536) NOT NULL,\n  created_at    timestamptz NOT NULL DEFAULT now(),\n  updated_at    timestamptz NOT NULL DEFAULT now()\n);\n\n-- Ensure one summary per user/window/tag combination\nCREATE UNIQUE INDEX IF NOT EXISTS uq_user_window_tag\n  ON public.user_memory_summaries (user_id, time_window, tag);\n\n-- HNSW index for fast vector similarity search (cosine distance)\nCREATE INDEX IF NOT EXISTS idx_summaries_hnsw\n  ON public.user_memory_summaries\n  USING hnsw (embedding vector_cosine_ops)\n  WITH (m = 16, ef_construction = 64);\n\n-- B-tree indexes for filtering\nCREATE INDEX IF NOT EXISTS idx_summaries_user_id\n  ON public.user_memory_summaries (user_id);\n\nCREATE INDEX IF NOT EXISTS idx_summaries_created_at\n  ON public.user_memory_summaries (created_at DESC);\n\n-- Enable RLS (service-role only access)\nALTER TABLE public.user_memory_summaries ENABLE ROW LEVEL SECURITY;\n\nCREATE POLICY \\"Service role full access on user_memory_summaries\\"\n  ON public.user_memory_summaries\n  FOR ALL\n  USING (auth.role() = 'service_role'::text);\n\n-- ============================================================================\n-- 2. EVERGREEN PROFILE TABLE\n-- ============================================================================\n-- Persistent profile traits: preferences, bio, work, goals\nCREATE TABLE IF NOT EXISTS public.user_profile_memory (\n  id            bigserial PRIMARY KEY,\n  user_id       uuid NOT NULL REFERENCES public.users(id) ON DELETE CASCADE,\n  tag           text NOT NULL DEFAULT 'profile',\n  content_text  text NOT NULL,\n  metadata      jsonb NOT NULL DEFAULT '{}',\n  embedding     vector(1536) NOT NULL,\n  updated_at    timestamptz NOT NULL DEFAULT now()\n);\n\n-- One profile entry per user/tag\nCREATE UNIQUE INDEX IF NOT EXISTS uq_user_profile_tag\n  ON public.user_profile_memory (user_id, tag);\n\n-- HNSW index for vector search\nCREATE INDEX IF NOT EXISTS idx_profile_hnsw\n  ON public.user_profile_memory\n  USING hnsw (embedding vector_cosine_ops)\n  WITH (m = 16, ef_construction = 64);\n\n-- B-tree index for user filtering\nCREATE INDEX IF NOT EXISTS idx_profile_user_id\n  ON public.user_profile_memory (user_id);\n\n-- Enable RLS (service-role only access)\nALTER TABLE public.user_profile_memory ENABLE ROW LEVEL SECURITY;\n\nCREATE POLICY \\"Service role full access on user_profile_memory\\"\n  ON public.user_profile_memory\n  FOR ALL\n  USING (auth.role() = 'service_role'::text);\n\n-- ============================================================================\n-- 3. AUTO-UPDATE TIMESTAMPS\n-- ============================================================================\n-- Trigger to auto-update updated_at on both tables\nCREATE TRIGGER trg_update_summaries_timestamp\n  BEFORE UPDATE ON public.user_memory_summaries\n  FOR EACH ROW\n  EXECUTE FUNCTION public.tg_set_updated_at();\n\nCREATE TRIGGER trg_update_profile_timestamp\n  BEFORE UPDATE ON public.user_profile_memory\n  FOR EACH ROW\n  EXECUTE FUNCTION public.tg_set_updated_at();\n\n-- ============================================================================\n-- 4. RPC: mem_recall - Blended Semantic Retrieval\n-- ============================================================================\n-- Fetches top-k relevant memories by vector similarity\n-- Returns mixed results from summaries + profile\n-- NOTE: Return column 'time_window' used instead of reserved keyword 'window'\nCREATE OR REPLACE FUNCTION public.mem_recall(\n  p_user_id uuid,\n  p_query_embedding vector(1536),\n  p_topk int DEFAULT 8\n)\nRETURNS TABLE(\n  source text,\n  tag text,\n  time_window text,\n  text_out text,\n  metadata jsonb,\n  score float8\n)\nLANGUAGE sql \nSTABLE \nPARALLEL SAFE\nSECURITY DEFINER\nSET search_path = public\nAS $$\n  -- Get top half from summaries\n  (\n    SELECT \n      'summary'::text AS source,\n      s.tag,\n      s.time_window,\n      s.summary_text AS text_out,\n      s.metadata,\n      (1 - (s.embedding <=> p_query_embedding))::float8 AS score\n    FROM public.user_memory_summaries s\n    WHERE s.user_id = p_user_id\n    ORDER BY s.embedding <=> p_query_embedding\n    LIMIT GREATEST(1, p_topk / 2)\n  )\n  UNION ALL\n  -- Get remaining from profile\n  (\n    SELECT \n      'profile'::text AS source,\n      p.tag,\n      NULL::text AS time_window,\n      p.content_text AS text_out,\n      p.metadata,\n      (1 - (p.embedding <=> p_query_embedding))::float8 AS score\n    FROM public.user_profile_memory p\n    WHERE p.user_id = p_user_id\n    ORDER BY p.embedding <=> p_query_embedding\n    LIMIT GREATEST(1, p_topk - GREATEST(1, p_topk / 2))\n  )\n  ORDER BY score DESC\n$$;\n\n-- ============================================================================\n-- 5. RPC: mem_upsert - Upsert Summary or Profile Entry\n-- ============================================================================\n-- Inserts or updates a memory entry with conflict resolution\n-- p_mode: 'summary' (needs p_window) | 'profile' (p_window ignored)\n-- NOTE: p_window parameter maps to time_window column\nCREATE OR REPLACE FUNCTION public.mem_upsert(\n  p_mode text,                 -- 'summary' | 'profile'\n  p_user_id uuid,\n  p_tag text,\n  p_window text,               -- required for 'summary'; ignored for 'profile'\n  p_text text,\n  p_embedding vector(1536),\n  p_metadata jsonb DEFAULT '{}'\n)\nRETURNS void\nLANGUAGE plpgsql \nSECURITY DEFINER\nSET search_path = public\nAS $$\nBEGIN\n  IF p_mode = 'summary' THEN\n    -- Upsert into summaries table\n    INSERT INTO public.user_memory_summaries (\n      user_id, time_window, tag, summary_text, metadata, embedding\n    )\n    VALUES (\n      p_user_id, p_window, p_tag, p_text, COALESCE(p_metadata, '{}'), p_embedding\n    )\n    ON CONFLICT (user_id, time_window, tag)\n    DO UPDATE SET\n      summary_text = EXCLUDED.summary_text,\n      metadata     = EXCLUDED.metadata,\n      embedding    = EXCLUDED.embedding,\n      updated_at   = now();\n      \n  ELSIF p_mode = 'profile' THEN\n    -- Upsert into profile table\n    INSERT INTO public.user_profile_memory (\n      user_id, tag, content_text, metadata, embedding\n    )\n    VALUES (\n      p_user_id, p_tag, p_text, COALESCE(p_metadata, '{}'), p_embedding\n    )\n    ON CONFLICT (user_id, tag)\n    DO UPDATE SET\n      content_text = EXCLUDED.content_text,\n      metadata     = EXCLUDED.metadata,\n      embedding    = EXCLUDED.embedding,\n      updated_at   = now();\n      \n  ELSE\n    RAISE EXCEPTION 'Unknown p_mode: % (use summary|profile)', p_mode;\n  END IF;\nEND;\n$$;\n\n-- ============================================================================\n-- 6. COMMENTS FOR DOCUMENTATION\n-- ============================================================================\nCOMMENT ON TABLE public.user_memory_summaries IS \n  'Time-boxed rolling summaries for user memory (day/week/lifetime). Column: time_window (not window due to SQL keyword).';\nCOMMENT ON TABLE public.user_profile_memory IS \n  'Evergreen user profile traits (preferences, bio, work, goals)';\nCOMMENT ON FUNCTION public.mem_recall IS \n  'Semantic retrieval via vector similarity. Returns time_window column (n8n tool should map to \\"window\\" in response).';\nCOMMENT ON FUNCTION public.mem_upsert IS \n  'Upsert memory entry. Parameter p_window maps to time_window column.';\n"}		alisonhattlovesyou@gmail.com	\N
